// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HousekeepingDashboard from './HousekeepingDashboard';
import ReservationForm from './ReservationForm';
import BusynessDashboard from './BusynessDashboard';

function App() {
  return (
    <Router>
      <div style={{ padding: '20px' }}>
        <nav>
          <ul style={{ listStyle: 'none', padding: 0, display: 'flex', gap: '20px' }}>
            <li><Link to="/">Housekeeping Dashboard</Link></li>
            <li><Link to="/reservations">Reservation Management</Link></li>
            <li><Link to="/busyness">Busyness Dashboard</Link></li>
          </ul>
        </nav>
        <hr />
        <Routes>
          <Route path="/" element={<HousekeepingDashboard />} />
          <Route path="/reservations" element={<ReservationForm />} />
          <Route path="/busyness" element={<BusynessDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
